import React from 'react'
import {
  Button,
  Col,
  Form,
  FormControl,
  InputGroup,
  Row,
} from 'react-bootstrap'

import data from '../Utils/data'

const Home = () => {
  return (
    <div>
      {
        <Form>
          {data.map((item) => (
            <Row className='mb-3' key={item.id}>
              <Col as='button' className=' shadow p-3 mb-5 bg-body rounded'>
                {item.question}
              </Col>
              <Col>{item.answer}</Col>
            </Row>
          ))}
          <Button variant='info' type='submit'>
            Submit
          </Button>
        </Form>
      }
    </div>
  )
}

export default Home
